import React from 'react'

class MiniBlock extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className='Block'>
                <h3>{this.props.title}</h3>
                <p>{this.props.paragraph}</p>
                <img src={this.props.img} />
            </div>

        )
    }

}

export default MiniBlock
